import axios from 'axios'
import { useEffect, useState } from 'react';
import { useDispatch } from 'react-redux';
import { doLoadSubscriptions } from '../redux/SubscriptionsActions';

const url = 'http://localhost:8000/subscriptions';

const SubscriptionComp = ({id}) => {
    const dispatch = useDispatch()
    const [subscriptions, setSubscriptions] = useState([])
    const [sub, setSub] = useState([])

    useEffect(() => {
      const fetchSubscriptions = async () => {
        const { data: subscriptionsData } = await axios.get(url);
        setSubscriptions(subscriptionsData);
        console.log(subscriptionsData);
        dispatch(doLoadSubscriptions(subscriptions));
      }
      fetchSubscriptions();
    }, [])

    const subscription = subscriptions.find((sub) => sub.movieId === id);
    setSub(subscription)

    console.log(sub)
    return (
    <div>
        <h5>Subscriptions Watched</h5>
        {/* {subscription.memberId} */}
    </div>
  )
}

export default SubscriptionComp
